import React from 'react';

import styles from './App.css';

function App() {

return (
    <div className="App">
        <header className="App-header">
            <p className={styles.pStyle1}>WELCOME</p>
            <p className={styles.pStyle2}>I'm an undergraduate</p>
            <p className={styles.pStyle2}>I'm a Software Engineer</p>
            <p className={styles.pStyle3}>I'M ALLEN ZHAI</p>
        </header>
    </div>
  );
}

export default App;
